import React from 'react'
import Entry from './Entry'


const TodoList = (props) => {

    const handleDel = (task) => {
        props.setList(
            props.list.filter(item => {
                if(item === task){
                    return false;
                }
            })
        )
    }


    return (
        <div>
            {
                props.list.map((entry, index) => {
                    return <Entry key={index} entry={entry}/>
                })
            }
        </div>
    )
}

export default TodoList
